import React, { Component } from 'react';
import SeccionForm from './SeccionForm';
import SeccionRadio from './SeccionRadio';
import 'bootstrap/dist/css/bootstrap.css';
import '../css/optimizacion.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faIceCream, faChartLine, faBox, faBoxes } from '@fortawesome/free-solid-svg-icons'


class FormOptimizacion extends React.Component{
    render(){
        return(
            <form>
                <SeccionForm titulo = "Sabores a producir" nombreTipo= "Sabor" nombreCantidad = "Demanda" iconoTitulo =  {faIceCream} iconoCantidad = {faChartLine} />
                <SeccionForm titulo = "Materias primas disponibles" nombreTipo= "Materia Prima" nombreCantidad = "Disponibilidad" iconoTitulo =  {faIceCream} iconoCantidad = {faChartLine}/>
                <SeccionRadio nombre = 'Objetivo'/>
                <button type="submit" class="btn btn-dark"><i class="fas fa-calculator"></i> Calcular</button>
            </form>
        );
    }
}

export default FormOptimizacion;
